        public List<StationModel> StationList
        {
            get
            {
                string[] citys = STATION_NAME.Split('@');
                List<StationModel> cityInfoList = new List<StationModel>();
                for (int i = 0; i < citys.Length; i++)
                {
                    string[] ci = citys[i].Split('|');
                    if (ci != null && ci.Length == 6)
                    {
                        StationModel info = new StationModel();
                        info.Name = ci[1];
                        info.LetterCode = ci[2];
                        info.NumCode = ci[5];
                        info.PYString = ci[3];
                        info.ShortPYString = ci[4];
                        info.VaguePYString = ci[0];
                        cityInfoList.Add(info);
                    }
                }
                return cityInfoList;
            }
        }

        /// <summary>
        /// 获取查询结果
        /// </summary>
        /// <param name="args">查询参数字典</param>
        public List<TrainModel> GetSearchData(Dictionary<string, string> args)
        {
            StringBuilder sb = new StringBuilder();
            if (args != null)
            {
                foreach (string key in args.Keys)
                {
                    sb.AppendFormat("{0}={1}&", key, System.Web.HttpUtility.UrlEncode(args[key], Encoding.UTF8));
                }
            }
            if (sb.Length > 0)
            {
                sb.Remove(sb.Length - 1, 1);
            }
            HttpHelper helper = new HttpHelper(string.Format("{0}?{1}", LinkAddress.TICKETSEARCH_ADDRESS, sb));
            helper.Request.Method = "GET";
            helper.Request.Accept = "text/plain, */*";
            helper.Request.Referer = LinkAddress.TICKETSEARCH_ADDRESS + "?method=init";//缺少该值服务器将返回500错误

            string str = helper.GetResponseSTRING().Replace(@"\n", "|");
            if (str.Equals("-1"))
            {
                throw new Exception("服务器忙，加载查询数据失败！");
            }
            if (str.Equals("-10"))
            {
                throw new Exception("您还没有登录或者离开页面的时间过长，请登录系统或者刷新页面");
            }
            string[] strs = str.Split('|');
            List<TrainModel> list = new List<TrainModel>();
            for (int i = 0; i < strs.Length; i++)
            {
                list.Add(new TrainModel(strs[i]));
            }
            return list;
        }
        /// <summary>
        /// 获取乘车人员列表
        /// </summary>
        /// <returns></returns>
        public List<PassengerModel> GetPassengers()
        {
            HttpHelper helper = new HttpHelper(LinkAddress.ALLPASSENGER_ADDRESS);
            Dictionary<string, string> dic = new Dictionary<string, string>();
            dic.Add("pageIndex", "0");
            dic.Add("pageSize", "100");
            dic.Add("passenger_name", "请输入汉字或拼音首字母");
            helper.Request.Method = "POST";
            helper.RequestData = dic;
            JsonObject json = null;
            try
            {
                json = helper.GetResponseJSON();
            }
            catch (ArgumentException ex)
            {
                return null;
            }
            if (json == null) return null;
            List<PassengerModel> list = new List<PassengerModel>();
            for (int i = 0; i < json["passengerJson"].Items.Count; i++)
            {
                list.Add(new PassengerModel(json["passengerJson"].Items[i].Object));
            }
            return list;
        }
